import React from "react";
import "./main.css";

const GalleryBox = (props) => {
  return (
    <div className="box" >
      <img src={props.img} alt="image loading" />
      <div className="content">
        <h3>{props.place}</h3>
        <p>{props.data}</p>
      </div>
      
    </div>
  );
};

export default GalleryBox;
